import React, { Component } from "react";
import {  withRouter, Link } from "react-router-dom";
import { connect } from "react-redux";
import { logoutUser } from "../../actions/authActions";

import "./Sidenav.css";
import logo from "../../images/logo2.jpg";
import { faSignOutAlt} from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

class SideNav extends Component {
  onLogoutClick = e => {
    this.props.logoutUser(this.props.history);
    window.location.href = "/";
  };

 
  render() {
  
    const { user } = this.props.auth;
    return (
 
      <div id="sidebar-collapse" class="col-sm-3 col-lg-2 sidebar">
      <div class="profile-sidebar">
          <center><img style={{width: "100px", height:"100px", alignSelf:"center"}} src={logo} alt="lodestar logo"></img></center>
            <h6 style={{ marginBottom: "20px", fontFamily:  "Nexa Light"}}>

              <center><b>Hello Admin,</b> {user.name.split(" ")[0]}</center>
            </h6>
       
     
        <div class="clear"></div>
      </div>
      <div class="divider"></div>
      <form role="search">
        <div class="form-group">
          <input type="text" class="form-control" placeholder="Search"/>
        </div>
      </form>
      <ul class="nav menu">
        <li><a href="index.html"><em class="fa fa-dashboard">&nbsp;</em> Dashboard</a></li>
        <li><a href="home.html"><em class="fa fa-home">&nbsp;</em> Home</a></li>
        <li class="active"><a href="investor.html"><em class="fa fa-line-chart">&nbsp;</em> Investor Relation</a></li>
        <li><a href="members.html"><em class="fa fa-users">&nbsp;</em> Members</a></li>
        <li><a href="downloadables.html"><em class="fa fa-download">&nbsp;</em> Downloadables</a></li>
        <li class="parent "><a data-toggle="collapse" href="#sub-item-1">
          <em class="fa fa-navicon">&nbsp;</em> Multilevel <span data-toggle="collapse" href="#sub-item-1" class="icon pull-right"><em class="fa fa-plus"></em></span>
          </a>
          <ul class="children collapse" id="sub-item-1">
            <li><a class="" href="/">
              <span class="fa fa-arrow-right">&nbsp;</span> Sub Item 1
            </a></li>
            <li><a class="" href="/">
              <span class="fa fa-arrow-right">&nbsp;</span> Sub Item 2
            </a></li>
            <li><a class="" href="/">
              <span class="fa fa-arrow-right">&nbsp;</span> Sub Item 3
            </a></li>
          </ul>
        </li>
        
    
            <Link exact activeClassName="active-page" onClick={this.onLogoutClick} style={{color: "#FF9933", fontFamily:  "Nexa Light"}}> 
                <FontAwesomeIcon icon={faSignOutAlt} style={{marginRight: "30px", marginLeft: "10px"}} ></FontAwesomeIcon>Logout
            </Link>    
          </ul>
         
        </div>
         
            
      
    );
  }
}
const mapStateToProps = state => ({
  projects: state.projects,
  auth: state.auth
});

export default withRouter(
  connect(
    mapStateToProps,
    { logoutUser }
  )(withRouter(SideNav))
);
